function SkillsPage() {
  const skillsList = ['Python','Javascript','CSS'];
  return (
    <div className="SkillsPages">
      {skillsList.map(skill => (
        <div className='skill-wrapper'>
          {skill.toUpperCase()}
        </div>
    ))}
    </div>
  );
}

export default SkillsPage;
